extern uint32_t mVideoPixels[];
extern uint8_t* appMemory;

int frames = 0;

int getState(int f)
{
    if (f <= path[0]) 
      return path[1];

    int low = 0, high = sizeof(path)/sizeof(path[0])/2 - 1, result = -1;
    while (low <= high) {
        int mid = (low + high) / 2;
        if (path[mid*2] <= f) {
            result = mid;
            low = mid + 1;
        } else {
            high = mid - 1;
        }
    }
    if (result < 0)
      exit(0);
    return path[result*2+1];
}

void applyState(int state)
{
  appMemory[0x10400 + 0xB884] = state;
  appMemory[0x10400 + 0xa85e] = state & 16 ? 0 : 0xff;
}

