extern "C" int apiRead(char* name, int readofs, int readlen, void* targetofs)
{
  char path[128] = "../dos/";
  strcat(path, name);  
  FILE* f = fopen(path, "rb");
  if (!f)
  {
    printf("Error\n");
    exit(0);
  }
  fseek(f, readofs, SEEK_SET);
  int read = fread(targetofs, 1, readlen, f);
  fclose(f);
  return read;
}

